//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

import "./LPT.sol";
import "./JMToken.sol";
import "./VJMToken.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "@uniswap/lib/contracts/libraries/Babylonian.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// indexed ->        search ,    
// unchecked ->      overflow   ->        
//                
//    unchecked     
/*
      (Swap)

    JMT token = 10000 
    ETH token = 20
     LiquidityPool Reserve   ,    
    A 100 JMT  ETH   
       10000*20 = 200000  
     A JMT100   
      10100  10100*20 = 202000  

        200000 
    202000  JMT ETH   

      x * 10100 = 200000    ( x  eth  )
     x   x = 200000/10100    
    x = 19.8019082 eth        (eth)reserve - x = 0.921980918 
       eth 0.921980918  (   ) 
*/
contract LiquidityPool is Ownable {
    event LiquidityAdded(address indexed _account);
    event LiquidityRemoved(address indexed _account);
    event TradedTokens(address indexed _account,uint256 _ethTraded,uint256 _jmtTraded);

    LPT lpToken; //  lp  
    JMToken jmtToken;
    VJMToken vJmt;

    uint256 ethReserve; //   
    uint256 jmtReserve;  //  jmt 
    uint32 lastBlockTimestamp;
    uint256 totalReserve; //   

    constructor () {
        ethReserve=0;
        jmtReserve=0;
    }

    modifier JonMatngOnly() {
        require(msg.sender == address(jmtToken), "JonMatng_ONLY");
        _;
    }
    // set funded reserve 
    function setFundedReserve() JonMatngOnly public {
        require(ethReserve != 0 && jmtReserve != 0,"RESERVE AMOUNT EMPTY");
        totalReserve = ethReserve*jmtReserve;
    }

    // lpt   
    function setLPTAddress(LPT _lpToken) external onlyOwner {
        require(address(lpToken) == address(0), "WRITE_ONCE");
        lpToken = _lpToken;
    }

    //  jmt   
    function setJmtCoinAddress(JMToken _jmtToken) external onlyOwner {
        require(address(jmtToken) == address(0), "WRITE_ONCE");
        jmtToken = _jmtToken;
    }
    // vJmt    
    function setVJMTCoinAddress(VJMToken _vJmt) external onlyOwner(){
        require(address(vJmt) == address(0), "WRITE_ONCE");
        vJmt = _vJmt;
